import footerImg from '../static/images/FOOTER.png';
import twImg from '../static/images/TWIITER.png'
import fbImg from '../static/images/FACEBOOK.png'
import igImg from '../static/images/INSTAGRAM.png'
import gitImg from '../static/images/GITHUB.png'

const footer = () => {
    return (
        <footer>
            <main>
                <section>
                    <h2>LOCATION</h2>
                    <p>Jalan Sumbersari,</p>
                    <p>Pekanbaru,</p>
                    <p>Indonesia</p>
                </section>
                <section>
                    <h2>Social Media</h2>
                    <figure>
                        <img src={twImg} alt={twImg}/>
                        <img src={fbImg} alt={fbImg}/>
                        <img src={igImg} alt={igImg}/>
                        <img src={gitImg} alt={gitImg}/>
                    </figure>
                </section>
                <section>
                    <h2>ABOUT FREELANCER</h2>
                    <p>Freelance is a free to use MIT</p>
                    <p>licensed Bootstrap theme created by</p>
                </section>
            </main>
        <style jsx>{`
            footer {
                margin-top: 2rem;
            }
            main {
                background: url(${footerImg});
                height: 20rem;
                display: flex;
                justify-content: center;
            }
            section {
                color: #ffffff;
                text-align: center;
                margin: 0 10rem;
            }
            section > h2 {
                font-family: 'Alice',serif;
                margin: 0;
            }
            section > p {
                font-family: 'Lato';
            }
            section figure {
                margin: 0;
            }
        `}</style>
        </footer>
    )
}

export default footer;
